    this._addQueue({
      target: target,
      args: this._init.call(this, ...arguments)
    });
  }

  static fromTo(target, fParams, tParams) {
    if (!Util.isType(tParams, 'Object') || !Util.isType(fParams, 'Object')) {
      return;
    }

    for (let key in fParams) {
