    };
  }

  static _animate() {
    if (!this._isAnimated) {
      this._isAnimated = true;
      Timer.add(this);
    }
  }

  static tick() {
    let renderTime = 1000 / 60;
    if (!this._animators.length || !this._isAnimated) {
      this.stop();
      return;
    }

    Util.each(this._animators, (animator) => {
